import React from "react";
import { Form } from "react-bootstrap";
import Input from "../../components/UI/Input";
/**
 * @author
 * @function Signup
 **/

const Signup = (props) => {
  return (
    <Form>
        <Input
                    label="Last Name"
                    placeholder="Last Name"
                    
                    type="text"
                    
                  />
    </Form>
  );
};

export default Signup;
